import React, { useState, useEffect } from 'react';
import { StyleSheet, Text, View, Image, ImageBackground, ScrollView, TouchableOpacity, FlatList,Alert} from 'react-native';
import { Feather } from '@expo/vector-icons';
import AnimatedLoader from "react-native-animated-loader";



const CityExplore = ({ route, navigation }) => {


    const myData = route.params.item;
    const [isLoading, setIsLoading] = useState(false);
    const [isLiked, setIsLiked] = useState(false);

   //list of attractions 
    const [data, setData] = useState([
        {
            name: 'Resturants',
            key: '1',
            image: {
                uri:
                    "data:image/jpeg;base64,"
            },
            apiName: 'poitype-Restaurant'
        },
        {
            name: 'Attractions',
            key: '2',
            image: {
                uri:
                    "data:image/jpeg;base64,"

            }
        },
        {
            name: 'Hotels',
            key: '3',
            image: {
                uri:
                    "data:image/jpeg;base64,"
            },
            apiName: 'hotels'
        },

    ])



    // get specific data from the api and based on the city and type of search(resturants,hotels...etc)
    const getDataAndContinue = (item) => {
        setIsLoading(true)
        if (item.name=='Attractions') {
            fetch('https://www.triposo.com/api/20200405/poi.json?tag_labels=beaches|dancing|zoos|museums|exploringnature|poitype-Park|poitype-Shopping_centre&location_id=' + (myData.cityNameApi) + '&order_by=-score&count=100&fields=id,score,intro,location_id,name,images,tags,properties&account=FOBIVROX&token=znghja9mhtwjjt5gsc8jydhayg07gkqz', {
                method: 'GET',
                headers: new Headers({
                    'Content-type': 'application/json; charset=UTF-8' //very important to add the 'charset=UTF-8'!!!!
                })
            })
                .then(res => {
                    return res.json()
                })
                .then((result) => {
                    const myApiData = result.results;
                    StopLoadingProccessWithNavigate(CloseLoading, myApiData,item);
    
                    (error) => {
                        console.warn("err post=", error);
                        setIsLoading(false)
                    };
                })
            
        } else {
            fetch('https://www.triposo.com/api/20200405/poi.json?tag_labels=' + (item.apiName) + '&location_id=' + (myData.cityNameApi) + '&order_by=-score&count=100&fields=id,score,intro,location_id,name,images,tags,properties&account=FOBIVROX&token=znghja9mhtwjjt5gsc8jydhayg07gkqz', {
                method: 'GET',
                headers: new Headers({
                    'Content-type': 'application/json; charset=UTF-8' //very important to add the 'charset=UTF-8'!!!!
                })
            })
                .then(res => {
                    return res.json()
                })
                .then((result) => {
                    const myApiData = result.results;
                    StopLoadingProccessWithNavigate(CloseLoading, myApiData,item);
    
                    (error) => {
                        console.warn("err post=", error);
                        setIsLoading(false)
                    };
                })
            
        }
      


    }

    const StopLoadingProccessWithNavigate = async (CloseLoading, myApiData,item) => {
        CloseLoading(myApiData,item);
    }
    const CloseLoading = (myApiData,item) => {
        setTimeout(() => {
            setIsLoading(false);
        }, 2500);
        navigateTo(myApiData,item);
    }
    const navigateTo = (myApiData,item) => {

        setTimeout(() => {
            navigation.navigate('MyTabs', { screen: 'MyExploreStack',params:{ screen:item.name,params:{myApiData: myApiData},},}); 
        }, 2500);
    }


    const GoBackToHomePage = () => {
        navigation.navigate('MainExplore');
    }
    return (
        <View style={{ backgroundColor: '#fff', flex: 1 }}>
            {isLoading && <AnimatedLoader
                visible={isLoading}
                overlayColor="rgba(255,255,255,0.75)"
                animationStyle={{ width: 100, height: 100 }}
                source={require("../../assets/loading.json")}
                speed={1}
            />}
            <ImageBackground
                source={myData.image}
                style={styles.image}
                imageStyle={{ borderBottomLeftRadius: 30, borderBottomRightRadius: 30 }}
            >
                <Text style={styles.Tagline}>Discover Israel</Text>
                <Text style={styles.Placename}>Explore the scenic beauty of {myData.title}</Text>

                <TouchableOpacity onPress={GoBackToHomePage} style={{
                    position: 'absolute', left: 20, top: 40,
                    backgroundColor: '#66b3ff', padding: 10, borderRadius: 40
                }}>
                    <Feather name='arrow-left' sise={24} color='#fff' />
                </TouchableOpacity>

                <TouchableOpacity style={{
                    position: 'absolute', right: 20, top: 40,
                    backgroundColor: '#66b3ff', padding: 10, borderRadius: 40
                }}>
                    <Feather name='heart' sise={24} color='#fff' />
                </TouchableOpacity>


            </ImageBackground>

            <ScrollView style={{ backgroundColor: 'white' }}>
                <Text style={{ padding: 14, fontSize: 20, fontWeight: 'bold' }}>
                    About the place
            </Text>
                <Text style={{
                    paddingHorizontal: 14, fontSize: 14, fontWeight: 'normal',
                    opacity: 0.3, justifyContent: 'flex-start', textAlign: 'justify',
                    lineHeight: 26
                }}>
                    {myData.description}
                </Text>
                <View>
                    <Text style={{ padding: 14, fontSize: 20, fontWeight: 'bold' }}>
                        Find out more in {myData.title}
                    </Text>
                    <FlatList
                        data={data}
                        horizontal={true}
                        renderItem={({ item }) => {
                            return (
                                <View style={{ paddingBottom: 40 }}>
                                    <View>
                                        <TouchableOpacity onPress={() => getDataAndContinue(item)}>
                                            <Image source={item.image} style={{ width: 150, height: 150, marginHorizontal: 10, borderRadius: 10 }} />
                                            <Text style={{
                                                marginHorizontal: 14, marginTop: 10, position: 'absolute', left: 10, bottom: 10,
                                                color: 'white', fontSize: 18
                                            }}>
                                                {item.name}

                                            </Text>
                                        </TouchableOpacity>

                                    </View>

                                </View>
                            )
                        }
                        }
                    />


                </View>

            </ScrollView>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
    image: {
        height: 380,
        justifyContent: 'flex-end'
    },
    Tagline: {
        color: 'white',
        fontSize: 16,
        fontWeight: 'bold',
        paddingHorizontal: 14,
        marginVertical: 4
    },
    Placename: {
        color: 'white',
        fontSize: 24,
        fontWeight: 'bold',
        paddingHorizontal: 14,
        marginBottom: 30
    }

});
export default CityExplore;
